@php
    $worksByProvince = DB::table('schools')
        ->leftJoin('artworks', 'schools.id', '=', 'artworks.school_id')
        ->select('schools.province_code', DB::raw('COUNT(artworks.id) as total_artworks'))
        ->groupBy('schools.province_code')
        ->pluck('total_artworks', 'schools.province_code')
        ->toArray();

    // Ambil semua kode provinsi yang ada
    $allProvinces = DB::table('master_province')
        ->select('code')
        ->distinct()
        ->pluck('code')
        ->toArray();

    $worksWithColors = [];

    foreach ($allProvinces as $provinceCode) {
        // Jika provinsi tidak memiliki karya, set total_artworks menjadi 0
        $totalArtworks = $worksByProvince[$provinceCode] ?? 0;

        if ($totalArtworks < 10 && $totalArtworks >= 1) {
            $color = '#D32F2F';
        } elseif ($totalArtworks <= 20 && $totalArtworks >= 10) {
            $color = '#F57C00';
        } elseif ($totalArtworks > 20) {
            $color = '#388E3C';
        } else {
            $color = '#565358'; // Warna default untuk provinsi dengan 0 karya
        }

        $worksWithColors[$provinceCode] = [
            'total_artworks' => $totalArtworks,
            'color' => $color,
        ];
    }
@endphp


