<script>
    function showMap(region) {
        const element = document.getElementById(region);
        if (!element.dataset.initialColorSet) { // Check if the color has been set initially
            element.style.fill = '#0097FF'; // Ganti dengan warna yang Anda inginkan

            const children = element.querySelectorAll('*');
            children.forEach(child => {
                child.style.fill = '#0097FF'; // Terapkan warna yang sama ke semua children
            });
        }
    }

    function hideMap(region) {
        const element = document.getElementById(region);
        const initialFillColor = element.getAttribute('data-fill');
        if (!element.dataset.initialColorSet) { // Check if the color has been set initially
            element.style.fill = initialFillColor; // Ganti dengan warna yang Anda inginkan

            const children = element.querySelectorAll('*');
            children.forEach(child => {
                child.style.fill = initialFillColor; // Terapkan warna yang sama ke semua children
            });
        }
    }

    function clickMap(region) {
        // Construct the new URL with the query parameter
        const newUrl = `${window.location.origin}${window.location.pathname}?provinsi=${encodeURIComponent(region)}`;

        // Navigate to the new URL
        window.location.href = newUrl;
    }

    function setInitialMapColor() {
        const urlParams = new URLSearchParams(window.location.search);
        const province = urlParams.get('provinsi');

        if (province) {
            const element = document.getElementById(province);
            if (element) {
                element.style.fill = '#0097FF';
                const children = element.querySelectorAll('*');
                children.forEach(child => {
                    child.style.fill = '#0097FF'; // Terapkan warna yang sama ke semua children
                });
                element.dataset.initialColorSet = 'true'; // Set a flag indicating the initial color has been set
            }
        }
    }

    // Use window.onload to ensure everything is fully loaded
    window.onload = setInitialMapColor;
</script>
